const Card = ({ userData }) => {
  return (
    <div className="w-60 h-60 flex justify-center items-center flex-col bg-igray-light rounded-2xl space-y-2 shadow-md p-4">
      <img
        className="shadow w-25 h-25 rounded-full object-cover"
        src={"../assets//" + userData.picture}
        alt=""
      />
      <div className="font-semibold font-pixel text-black">
        {userData.name + " " + userData.lastName}
      </div>
      <div className="font-semibold font-pixel text-black">
        {userData.group}
      </div>
    </div>
  );
};

export default Card;
